@EmilySenefeld I'm going to be selfish and nominate my book #thinkingaboutteaching from @edumatch. 
Love the @UBuffalo dig podcast
On history

@braddeathridge @myspacefiend @DrEricDing @UBuffalo If the side effect illness was Guillian-Barr√©, that's a really big problem

It's potentially fatal, and if not, can have long term effects

Not a good outcome for a trial

@braddeathridge @myspacefiend @DrEricDing @UBuffalo Very similar, but more acute, yes

I guess the only "good thing" about #GuillainBarre is it seems to be a one time only thing.

I have learned a lot from the @gbscidp foundation; they put on a very informative conference the other weekend

@myspacefiend @DrEricDing @UBuffalo It has. My journey started very dark, but most journeys do.

I've learned (much of it from my psychologist) that I have to choose happiness

I know it sounds too easy, but it's true. And hopefully I can spread some positivity to people I meet along the way

@myspacefiend @DrEricDing @UBuffalo So, I guess that's my #guillainbarr√© story

There's a reason that the hashtag doesn't bring up much; it's because the syndrome is so rare

And, tying back to Capitalism, rare diseases are only studied if some rich persons kid gets it

@myspacefiend @DrEricDing @UBuffalo So, I was in the hospital for five days, getting transfusions of immunoglobulin

Luckily we caught it before the paralysis got to my heart or diaphragm

I have had to relearn how to walk and, well, do everything again. My legs are still not working they way they should
